import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form action="">
          <label htmlFor="">Input :</label>
          <input type="textarea" />
        </form>
      </header>
    </div>
  );
}

export default App;
